import React from "react";

const Carddata = () => {
    return (
        <>
            <div className="container">
                <div className="row">
                    <div className="col-12 col-md-6">
                        <img className="carddata-image" src={process.env.PUBLIC_URL + "/Images/painting3.jpg"} alt="Random_Image" />
                    </div>
                </div>
            </div>
        </>
    )
};

export default Carddata;
